# codetree 비를 피하기

# 방법1
# 
# 각 사람마다 별도의 BFS를 진행
#
# BFS의 시간복잡도 = O(N^2)
# BFS를 총 사람의 횟수 (H)번 만큼 수행
#
# 최종 시간복잡도 => O(H * N^2)
# 1억 정도 반복 => maybe 통과 가능

# ==============================

# 방법2
#
# 탈출구를 시작점으로 해서 BFS를 돌린다.
# 이때 탈출구를 처음에 싹다 넣는다.
#
# BFS의 시간복잡도 = O(N^2)
# BFS를 단 1번 수행한다.
#
# 최종 시간복잡도 => O(N^2)

from collections import deque

n, h, m = map(int, input().split())
grid = [list(map(int, input().split())) for _ in range(n)]

# visited[y][x] = 출구(3)까지의 최단거리 (없으면 -1)
visited = [[-1] * n for _ in range(n)]

# 4방향
dys = (-1, 0, 1, 0)
dxs = (0, 1, 0, -1)

def in_range(y, x):
    return 0 <= y < n and 0 <= x < n

def bfs_from_all_exits():
    """모든 출구(3)를 시작점으로 동시에 BFS → 각 칸의 '가장 가까운 출구' 거리 계산"""
    q = deque()

    # 1) 출구들을 큐에 전부 넣고 거리 0으로 시작
    for y in range(n):
        for x in range(n):
            if grid[y][x] == 3:
                q.append((y, x))
                visited[y][x] = 0

    # 2) BFS 한 번으로 전체 거리 채우기
    while q:
        y, x = q.popleft()
        for d in range(4):
            ny, nx = y + dys[d], x + dxs[d]
            if not in_range(ny, nx):
                continue
            if visited[ny][nx] != -1:
                continue
            if grid[ny][nx] == 1:         # 벽(건물)은 통과 불가
                continue

            visited[ny][nx] = visited[y][x] + 1
            q.append((ny, nx))

bfs_from_all_exits()

# 3) 출력: 사람(2)이 있는 칸만 거리를 출력, 그 외는 0
#   - 도달 불가면 visited가 -1이므로 그대로 -1을 출력하는 것이 일반적
#     (문제 요구에 따라 -1/0 중 선택. 여기서는 -1을 유지)
for y in range(n):
    row_out = []
    for x in range(n):
        if grid[y][x] == 2:
            row_out.append(str(visited[y][x]))
        else:
            row_out.append('0')
    print(' '.join(row_out))

